import React, { useState } from 'react';
import { Link, Route, Routes } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';
import Classes from './Classes';
import Courses from './Courses';
import Monitoring from './Monitoring';
import Rating from './Rating';
import Reports from './Reports';

const PLDashboard = () => {
  const [sidebarOpen, setSidebarOpen] = useState(false);

  return (
    <div
      style={{
        display: 'flex',
        minHeight: '100vh',
        fontFamily: 'Arial, sans-serif',
        backgroundColor: '#f4f6f9',
        position: 'relative', // for absolute logout button
      }}
    >
      {/* Sidebar */}
      <nav
        style={{
          minHeight: '100vh',
          width: sidebarOpen ? '250px' : '200px',
          transition: 'width 0.3s ease-in-out',
          backgroundColor: '#007bff',
          boxShadow: '2px 0 5px rgba(0,0,0,0.1)',
          overflowY: 'auto',
        }}
      >
        <button
          onClick={() => setSidebarOpen(!sidebarOpen)}
          style={{
            backgroundColor: '#ffffff',
            color: '#007bff',
            border: 'none',
            padding: '8px 15px',
            borderRadius: '5px',
            width: '100%',
            fontSize: '16px',
            fontWeight: '500',
            cursor: 'pointer',
            marginBottom: '15px',
          }}
          onMouseOver={(e) => (e.target.style.backgroundColor = '#e9ecef')}
          onMouseOut={(e) => (e.target.style.backgroundColor = '#ffffff')}
        >
          {sidebarOpen ? '<< Collapse' : '>> Expand'}
        </button>
        <ul style={{ listStyle: 'none', padding: 0, margin: 0 }}>
          {['Classes', 'Courses', 'Monitoring', 'Rating', 'Reports'].map((item, idx) => (
            <li key={idx} style={{ marginBottom: '15px' }}>
              <Link
                to={`/pl/dashboard/${item.toLowerCase()}`}
                style={{
                  display: 'block',
                  padding: '10px 15px',
                  textDecoration: 'underline',
                  color: '#fff',
                  fontSize: '16px',
                  borderRadius: '5px',
                  transition: 'background-color 0.2s',
                }}
                onMouseOver={(e) => (e.target.style.backgroundColor = 'rgba(255,255,255,0.1)')}
                onMouseOut={(e) => (e.target.style.backgroundColor = 'transparent')}
              >
                {item}
              </Link>
            </li>
          ))}
        </ul>
      </nav>

      {/* Main Content */}
      <main
        style={{
          flex: 1,
          padding: '20px',
          backgroundColor: '#ffffff',
          marginLeft: sidebarOpen ? '250px' : '200px',
          transition: 'margin-left 0.3s',
          position: 'relative', // For logout
        }}
      >
        {/* Logout Button at Top-Right Corner */}
        <button
          style={{
            position: 'absolute',
            top: '10px',
            right: '20px',
            backgroundColor: '#b0c4de',
            border: 'none',
            padding: '8px 16px',
            borderRadius: '5px',
            cursor: 'pointer',
            textDecoration: 'underline',
            fontWeight: 'bold',
          }}
          onClick={() => {
            // logout logic here
            localStorage.removeItem('token');
            window.location.href = '/login';
          }}
        >
          Logout
        </button>

        {/* Header */}
        <div
          style={{
            backgroundColor: '#007bff',
            padding: '20px',
            borderRadius: '5px',
            marginBottom: '20px',
            color: '#fff',
            textAlign: 'center',
            borderBottom: '2px solid #0056b3',
            position: 'relative',
          }}
        >
          <h2 style={{ textDecoration: 'underline', margin: 0 }}>Principal Lecturer Dashboard</h2>
        </div>

        {/* Routes Content */}
        <div>
          <Routes>
            <Route path="classes" element={<Classes />} />
            <Route path="courses" element={<Courses />} />
            <Route path="monitoring" element={<Monitoring />} />
            <Route path="rating" element={<Rating />} />
            <Route path="reports" element={<Reports />} />
          </Routes>
        </div>
      </main>
    </div>
  );
};

export default PLDashboard;
